import React, { useEffect, useState } from "react";
import { MDBContainer, MDBRow, MDBBtn, MDBCol} from "mdb-react-ui-kit";
import { TextField } from "@mui/material";
import useAxiosPrivate from "../hooks/useAxiosPrivate";
import axios from "axios";

function Search(props) {

  const axiosInstance = useAxiosPrivate()

  const [query, setQuery] = useState("")

  const [results, setResults] = useState()

  useEffect(()=> {
    console.log(query)
  }, [query])


  //Bisher Suche nur nach Transaktionen
  function handleSearch(query) {
    axiosInstance.get('transactions/?search=' + query).then((res) => {
      console.log(res)
      setResults(res.data)
    })

  }

  return (
    <div>
      <MDBContainer>
      <MDBRow>
        <h3>Suche</h3>
      </MDBRow>
      <MDBRow>
        <MDBCol>
        <TextField
            className="mb-3"
            sx={{ minWidth: 550, maxWidth: 550 }}
            id="suchbegriff"
            name="suchbegriff"
            label="Suchbegriff"
            variant="outlined"
            onChange={(event) => setQuery(event.target.value)}
          />
        </MDBCol>
        <MDBCol>
          <MDBBtn
                onClick={handleSearch(query)}
          > Abschicken</MDBBtn>
        </MDBCol>
      </MDBRow>
      <MDBRow>
        <h5>
          Suche nach Auftr√§gen/Partnern: <i>{query}</i>
        </h5>

      </MDBRow>
      <MDBRow>
      {results.map((transactionData) => (
          <React.Fragment>
            <Transaction
              key={transactionData.id}
              id={transactionData.id}
              title={transactionData.description}
              added={transactionData.date_added}
              exportAddress={transactionData.partnership.partner.name}
              exportStreet={transactionData.partnership.partner.street}
              exportCity={transactionData.partnership.partner.city}
              exportCountry={transactionData.partnership.partner.country_code}
              importAddress={transactionData.importAddress}
              importStreet={transactionData.importStreet}
              importCity={transactionData.importCity}
              importCountry={transactionData.importCountry}
              stakeholderCount={transactionData.stakeholderCount}
              lastChange={transactionData.date_processed}
              status={transactionData.status}
            />
            <br />
          </React.Fragment>
        ))}

      </MDBRow>

      </MDBContainer>
    </div>
  );
}

export default Search;
